import{_ as a,c as o,o as i,ae as t}from"./chunks/framework.Cthp9TdA.js";const s=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"06_http/常见的Content-Type类型和含义.md","filePath":"06_http/常见的Content-Type类型和含义.md"}'),l={name:"06_http/常见的Content-Type类型和含义.md"};function c(d,e,p,n,r,m){return i(),o("div",null,e[0]||(e[0]=[t('<blockquote><p>HTTP Content-Type 标头用于指定请求或响应主体的媒体类型。它告诉接收者如何解析数据。以下是一些常见的 Content-Type 类型及其含义：</p></blockquote><h4 id="文本类型-text" tabindex="-1">文本类型 (text) <a class="header-anchor" href="#文本类型-text" aria-label="Permalink to &quot;文本类型 (text)&quot;">​</a></h4><ul><li><code>text/plain</code>: 纯文本，没有任何格式。例如 <code>.txt</code> 文件。</li><li><code>text/html</code>: HTML 格式的文本，用于网页。</li><li><code>text/css</code>: CSS 样式表。</li><li><code>text/javascript</code> (或 <code>application/javascript</code>): JavaScript 代码。</li></ul><h4 id="应用类型-application" tabindex="-1">应用类型 (application) <a class="header-anchor" href="#应用类型-application" aria-label="Permalink to &quot;应用类型 (application)&quot;">​</a></h4><ul><li><code>application/json</code>: JSON (JavaScript Object Notation) 数据格式，常用于 API 数据交换。</li><li><code>application/xml</code>: XML (Extensible Markup Language) 数据格式，也用于数据交换和配置文件。</li><li><code>application/x-www-form-urlencoded</code>: 表单数据，通常在 HTML 表单提交时使用。数据被编码为键值对，键和值之间使用 = 分隔，键值对之间使用 <code>&amp;</code> 分隔。例如：<code>name=John&amp;age=30</code>。</li><li><code>application/octet-stream</code>: 任意的二进制数据流，用于下载文件。浏览器通常会提示用户保存文件。</li><li><code>application/pdf</code>: PDF (Portable Document Format) 文档。</li><li><code>application/zip</code>: ZIP 压缩文件。</li></ul><h4 id="图像类型-image" tabindex="-1">图像类型 (image) <a class="header-anchor" href="#图像类型-image" aria-label="Permalink to &quot;图像类型 (image)&quot;">​</a></h4><ul><li><code>image/jpeg</code> 或 <code>image/jpg</code>: JPEG 图像。</li><li><code>image/png</code>: PNG 图像。</li><li><code>image/gif</code>: GIF 图像。</li><li><code>image/svg+xml</code>: SVG (Scalable Vector Graphics) 矢量图。</li></ul><h4 id="音频-视频类型-audio-video" tabindex="-1">音频/视频类型 (audio/video) <a class="header-anchor" href="#音频-视频类型-audio-video" aria-label="Permalink to &quot;音频/视频类型 (audio/video)&quot;">​</a></h4><ul><li><code>audio/mpeg</code>: MP3 音频。</li><li><code>audio/ogg</code>: Ogg 音频。</li><li><code>video/mp4</code>: MP4 视频。</li><li><code>video/webm</code>: WebM 视频。</li></ul><h4 id="多部分类型-multipart" tabindex="-1">多部分类型 (multipart) <a class="header-anchor" href="#多部分类型-multipart" aria-label="Permalink to &quot;多部分类型 (multipart)&quot;">​</a></h4><ul><li><code>multipart/form-data</code>: 用于表单文件上传。表单中的文件和其他字段一起传输。这是上传文件时常用的类型。</li><li><code>multipart/byteranges</code>: 用于表示部分请求的数据范围，通常用于断点续传。</li><li><code>multipart/mixed</code>: 用于发送多种不同类型的数据。</li></ul>',11)]))}const h=a(l,[["render",c]]);export{s as __pageData,h as default};
